import React from 'react';
import { connect } from 'react-redux';
import { Link } from 'react-router-dom';
import { Container, Grid } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';

import Button from '../components/Button';

import { getLaunches, getRockets } from '../fetch/getter';

import { addToCounter, subtractFromCounter } from '../redux/actions/counter';

const useStyles = makeStyles({
  container: {
    margin: '50px',
  }
});

const HomePage = ({ count, incrementCount, decrementCount }) => {

  const classes = useStyles();

  return (
    <div className={classes.container}>
      <div>
        <h1>Welcome Home</h1>
        <Button
          onClick={() => {
            incrementCount();
          }}
          title="Increment Count"
        />
        <Button
          onClick={() => {
            decrementCount();
          }}
          title="Decrement Count"
        />
        <Button
          onClick={() => {
            getLaunches();
          }}
          title="Get Launches"
        />
        <Button
          onClick={() => {
            getRockets();
          }}
          title="Get Rockets"
        />
        Your current count is {count}
      </div>
      <Link
        to="/test"
      >
      To Test Page
      </Link>
    </div>
  )
}

const mapStateToProp = (state) => {
  const { counter } = state;
  return {
    count: counter.count,
  };
};

const mapDispatchToProps = (dispatch) => {
  return {
    incrementCount: () => {
      dispatch(addToCounter());
    },
    decrementCount: () => {
      dispatch(subtractFromCounter());
    },
  }
}

export default connect(mapStateToProp, mapDispatchToProps)(HomePage);
